import { Card, CardContent, FormGroup, Typography } from '@material-ui/core'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      {card.map((e, i) => (
        <Card sx={{ mb: 2, width: '78%', height: 120, ml: 2 }}>
          <FormGroup row>
            <img
              src={imag4}
              alt=''
              style={{
                width: '100px',
                height: '100px',
                margin: '10px',
              }}
            />
            <Typography variant='body1'>{e.title}</Typography>
          </FormGroup>
        </Card>
      ))}
    </>
  )
}
